s invalid'=>'Siuntėjo įvestas skaičiaus formatas nėra tinkamas','This contact form has file uploading fields, but the temporary folder for the files (%s) does not exist or is not writable. You can create the folder or change its permission manually.'=>'Šioje kontaktų formoje yra failų įkėlimo laukai, tačiau laikinas failų aplankas (%s) neegzistuoja arba į jį negalima rašyti. Galite sukurti aplanką arba pakeisti jo leidimą rankiniu būdu.','Acceptable file types'=>'Priimtini failų tipai','file'=>'failas','Uploading a file fails for PHP error'=>'Failo įkėlimas dėl PHP klaidos nepavyksta','Uploaded file is too large'=>'Įkeltas failas yra per didelis','Uploaded file is not allowed for file type'=>'Įkeltas neleidžiamo tipo failas.','Uploading a file fails for any reason'=>'Failo įkėlimas dėl įvairių priežasčių nepavyksta','Max'=>'Maks.','Min'=>'Min.','Range'=>'Intervalas','Default value'=>'Numatytoji reikšmė','Date field'=>'Datos laukelis','date'=>'data','Date is later than maximum limit'=>'Data yra vėlesnė už maksimalų limitą','Date is earlier than minimum limit'=>'Data yra ankstesnė už minimalų limitą','Date format that the sender entered is invalid'=>'Siuntėjo įvestas datos formatas nėra tinkamas','Field type'=>'Laukelio tipas','radio buttons'=>'radio','checkboxes'=>'checkboxes','This contact form contains CAPTCHA fields, but the necessary libraries (GD and FreeType) are not available on your server.'=>'Ši kontaktų forma turi CAPTCHA laukelių, bet reikiamos bibliotekos (GD ir FreeType) nepasiekiamos jūsų serveryje.','This contact form contains CAPTCHA fields, but the temporary folder for the files (%s) does not exist or is not writable. You can create the folder or change its permission manually.'=>'Šioje kontaktų formoje yra CAPTCHA laukelių, laikinas failų aplankas (%s) neegzistuoja arba nėra įrašomas. Galite sukurti aplanką arba pakeisti jo leidimus (angl. permissions).','Your entered code is incorrect.'=>'Jūsų įvestas kodas yra neteisingas.','The code that sender entered does not match the CAPTCHA'=>'Siuntėjo įvestas kodas neatitinka CAPTCHA','Insert Tag'=>'Įterpti žymę','Class attribute'=>'Klasės atributas','Acceptance checkbox'=>'Sutikimo laukelis','acceptance'=>'sutikimas','<code>%1$s</code> property of a <code>WPCF7_ContactForm</code> object is <strong>no longer accessible</strong>. Use <code>%2$s</code> method instead.'=>'<code>%1$s</code> property of a <code>WPCF7_ContactForm</code> object is <strong>no longer accessible</strong>. Use <code>%2$s</code> method instead.','Untitled'=>'Be pavadinimo','Contact Form'=>'Kontaktų forma','There is a field with input that is shorter than the minimum allowed length'=>'Formoje yra laukas su reikšme, kuri yra trumpesnė nei minimalus leidžiamas ilgis','There is a field with input that is longer than the maximum allowed length'=>'Formoje yra laukas su reikšme, kuri yra ilgesnė nei maksimalus leidžiamas ilgis','There is a field that the sender must fill in'=>'Yra laukelis, kurį siuntėjas privalo užpildyti','There are terms that the sender must accept'=>'Yra sąlygos, su kuriomis siuntėjas turi sutikti','Submission was referred to as spam'=>'Pateikta žinutė pažymėta kaip spamas.','Validation errors occurred'=>'Validacijos klaidos','Sender\'s message failed to send'=>'Siuntėjo žinutė neišsiųsta','Sender\'s message was sent successfully'=>'Siuntėjo žinutė išsiųsta','Message Body:'=>'Žinutės turinys:','Subject: %s'=>'Tema: %s','From: %s'=>'Nuo: %s','Send'=>'Siųsti','Your message'=>'Jūsų pranešimas','Your email'=>'Jūsų el. paštas','Your name'=>'Jūsų vardas','Form-tag Generator: %s'=>'Formos žymių generatorius: %s','For more information:'=>'Daugiau informacijos:','Any information you provide will not be shared with service providers without your authorization.'=>'Bet kokia informacija, kurią pateiksite, nebus dalijimąsi su paslaugų teikėjais be Jūsų sutikimo.','You may need to first sign up for an account with the service that you plan to use. When you do so, you would need to authorize Contact Form 7 to access the service with your account.'=>'Pirmiausia reiktų susikurti paskyrą pas tą paslaugos teikėją, kurio paslauga norite naudotis. Kai tai atliksite, Jums reikės autorizuoti Contact Form 7 prisijungimą prie tos paskyros.','On this screen, you can manage services that are available through Contact Form 7. Using API will allow you to collaborate with any services that are available.'=>'Šiame ekrane galite valdyti paslaugas, susijusias su Contact Form 7. Naudojant API Jūs galite integruoti bet kokias paslaugas kurios Jums prieinamos.','There are also special mail-tags that have specific names, but do not have corresponding form-tags. They are used to represent meta information of form submissions like the submitter&#8217;s IP address or the URL of the page.'=>'Taip pat yra specialios laiško žymės su specialiais pavadinimais, kurios neturi jas atitinkančių formos žymų. Jos naudojamos perduoti meta-informacijai formos pateikimo metu, pavyzdžiui, pateikėjo IP adresas arba formos puslapio URL.','A mail-tag is also a short code enclosed in square brackets that you can use in every Mail and Mail (2) field. A mail-tag represents a user input value through an input field of a corresponding form-tag.'=>'Laiško žymė yra speciali tekstinė reikšmė apgaubta laužtiniais skliaustais. Ją galite naudoti bet kuriame Laiškas ir Laiškas (2) lauke. Laiško žymė atitinka vartotojo įrašytą reikšmę per formos lauką sugeneruotą su atitinkama formos žyme.','While form-tags have a comparatively complex syntax, you do not need to know the syntax to add form-tags because you can use the straightforward tag generator (<strong>Generate Tag</strong> button on this screen).'=>'Kadangi formos žymės turi sudėtingą sintaksę, Jums nereikia jos mokėti norint pridėti formos žymes į formą, kadangi galite naudoti mūsų žymių generatorių (žr. <strong> mygtukus virš formos lauko</strong>).','A form-tag is a short code enclosed in square brackets used in a form content. A form-tag generally represents an input field, and its components can be separated into four parts: type, name, options, and values. Contact Form 7 supports several types of form-tags including text fields, number fields, date fields, checkboxes, radio buttons, menus, file-uploading fields, CAPTCHAs, and quiz fields.'=>'Formos žymė yra tekstinė reikšmė laužtiniuose skliaustuose, naudojama formos turinyje. Formos žymė atitinka formos lauką, ji turi keturis elementus: tipą, pavadinimą, pasirinkimus ir reikšmes. Contact form 7 palaiko kelis formos žymių tipus, pavyzdžiui, teksto laukas, skaičiaus laukas, datos laukas, checkboxes, radio, meniu, failo įkėlimo laukas, apklausos ir CAPTCHA laukai.','<strong>Additional Settings</strong> provides a place where you can customize the behavior of this contact form by adding code snippets.'=>'<strong>Papildomi nustatymai</strong> yra vieta Jūsų pakeitimams, įtakojantiems formos funkcijas, čia įrašykite savo tam skirtą kodą.','In <strong>Messages</strong>, you can edit various types of messages used for this contact form. These messages are relatively short messages, like a validation error message you see when you leave a required field blank.'=>'Skiltyje <strong>Pranešimai</strong> galite redaguoti formos pranešimus, rodomus tinklalapyje. Tai trumpi informaciniai pranešimai, įspėjantys apie tokius dalykus, kaip neužpildytas būtinas laukelis.','<strong>Mail (2)</strong> is an additional mail template that works similar to Mail. Mail (2) is different in that it is sent only when Mail has been sent successfully.'=>'<strong>Laiškas (2)</strong> yra papildomas laiško šablonas, kuris veikia panašiai kaip pagrindinis Laiškas. Laiškas (2) skiriasi tuo, kad jis siunčiamas tik tada, kai Laiškas buvo išsiųstas sėkmingai.','<strong>Mail</strong> manages a mail template (headers and message body) that this contact form will send when users submit it. You can use Contact Form 7&#8217;s mail-tags here.'=>'Skiltis <strong>Laiškas</strong> yra skirta laiško šablonui redaguoti (tiek headers, tiek pačiam turiniui. Šis laiškas bus siunčiamas kai tik lankytojas užpildo formą. Šiame laiške galite naudoti Contact Form 7 laiško žymes.','<strong>Form</strong> is a content of HTML form. You can use arbitrary HTML, which is allowed inside a form element. You can also use Contact Form 7&#8217;s form-tags here.'=>'<strong>Forma</strong> yra HTML tipo formos turinys. Galite naudoti HTML formos elemento viduje. Taip pat galite naudoti Contact Form 7 formos žymes.','<strong>Title</strong> is the title of a contact form. This title is only used for labeling a contact form, and can be edited.'=>'<strong>Pavadinimas</strong> yra Jūsų norimas kontaktų formos pavadinimas. Jis naudojamas tiesiog norint atskirti formas vienas nuo kitų, ir gali būti bet kada redaguojamas.','On this screen, you can edit a contact form. A contact form is comprised of the following components:'=>'Šiame ekrane Jūs galite redaguoti savo kontaktų formą. Ji susideda iš tokių elementų:','<strong>Duplicate</strong> - Clones that contact form. A cloned contact form inherits all content from the original, but has a different ID.'=>'<strong>Daryti kopiją</strong> - ši funkcija klonuoja pasirinktą kontaktų formą. Klonuota kontaktų forma būna tokio paties turinio kaip originali, tačiau turi skirtingą ID.','<strong>Edit</strong> - Navigates to the editing screen for that contact form. You can also reach that screen by clicking on the contact form title.'=>'<strong>Redaguoti</strong> - nukelia į formos redagavimo ekraną. Ten pat galite patekti tiesiog paspaudę ant kontaktų formos pavadinimo.','Hovering over a row in the contact forms list will display action links that allow you to manage your contact form. You can perform the following actions:'=>'Užėjus su pele ant konkrečios kontaktų formos eilutęs visame jų sąraše, bus parodyti galimi formos valdymo veiksmai:','On this screen, you can manage contact forms provided by Contact Form 7. You can manage an unlimited number of contact forms. Each contact form has a unique ID and Contact Form 7 shortcode ([contact-form-7 ...]). To insert a contact form into a post or a text widget, insert the shortcode into the target.'=>'Šiame ekrane galite valdyti kontaktų formas, sukurtas naudojant Contact Form 7. Galite naudoti neribotą kiekį formų. Kiekviena forma turi savo unikalų ID ir įterpimo kodą ([contact-form-7-...]). Norėdami įkelti kontaktų formą į puslapį, įrašą arba valdiklį, tiesiog įrašykite jos įterpimo kodą.','Mail-tags'=>'Laiško žymės','Form-tags'=>'Formos žymės','Available Actions'=>'Galimi veiksmai','Overview'=>'Apžvalga','You can add customization code snippets here. For details, see %s.'=>'Čia galite įkelti savo kodo pakeitimus. Daugiau informacijos: %s.','https://contactform7.com/additional-settings/'=>'https://contactform7.com/additional-settings/','File attachments'=>'Prikabinti failai','Use HTML content type'=>'Naudoti HTML turinio tipą','Exclude lines with blank mail-tags from output'=>'Nerodyti eilučių kurios neturi reikšmių','Message body'=>'Žinutės tekstas','Additional headers'=>'Papildomos antraštės','Subject'=>'Tema','From'=>'Nuo','To'=>'Kam','In the following fields, you can use these mail-tags:'=>'Šiuose laukuose galite naudoti tokias laiško laukų žymes:','Mail (2) is an additional mail template often used as an autoresponder.'=>'Laiškas (2) yra papildomas laiško šablonas, dažniausiai naudojamas kaip auto-atsakymas.','Use Mail (2)'=>'Naudoti laišką (2)','Mail (2)'=>'Laiškas (2)','Y/m/d'=>'Y-m-d','Edit &#8220;%s&#8221;'=>'Redaguoti „%s“','Edit'=>'Redaguoti','Date'=>'Data','Author'=>'Autorius','Shortcode'=>'Įterpimo kodas','Title'=>'Pavadinimas','Additional Settings'=>'Papildomi nustatymai','Additional Settings (%d)'=>'Papildomi nustatymai (%d)','Messages'=>'Pranešimai','Mail'=>'Laiškas','Form'=>'Forma','Support'=>'Pagalba','https://contactform7.com/support/'=>'https://contactform7.com/support/','FAQ'=>'DUK','https://contactform7.com/faq/'=>'https://contactform7.com/faq/','Docs'=>'Dokumentacija','https://contactform7.com/docs/'=>'https://contactform7.com/docs/','Delete'=>'Ištrinti','Duplicate'=>'Daryti kopiją','Status'=>'Statusas','You can also use this old-style shortcode:'=>'Taip pat galite naudoti ir tokį senos versijos įterpimo kodą:','Copy this shortcode and paste it into your post, page, or text widget content:'=>'Nukopijuokite šį įterpimo kodą ir įkelkite jį į norimą įrašą, puslapį ar valdiklį:','Enter title here'=>'Įveskite pavadinimą','Save'=>'Išsaugoti','You are not allowed to edit this contact form.'=>'Jums neleidžiama redaguoti šios kontaktų formos.','https://contactform7.com/save-submitted-messages-with-flamingo/'=>'https://contactform7.com/save-submitted-messages-with-flamingo/','Spam filtering with Akismet'=>'Brukalų filtravimas su Akismet','https://contactform7.com/spam-filtering-with-akismet/'=>'https://contactform7.com/spam-filtering-with-akismet/','Setting up mail'=>'Laiškų nustatymai','https://contactform7.com/setting-up-mail/'=>'https://contactform7.com/setting-up-mail/','Contact Form 7 needs your support.'=>'Contact Form 7 reikalingas Jūsų palaikymas.','Dismiss'=>'Uždaryti','<strong>Contact Form 7 %1$s requires WordPress %2$s or higher.</strong> Please <a href="%3$s">update WordPress</a> first.'=>'<strong>Contact Form 7 %1$s reikalinga WordPress %2$s arba naujesnė versija.</strong> <a href="%3$s">Atnaujinkite WordPress</a>.','Settings'=>'Nustatymai','Contact form deleted.'=>'Kontaktų forma ištrinta.','Contact form saved.'=>'Kontaktų forma išsaugota.','Contact form created.'=>'Kontaktų forma sukurta.','Search Contact Forms'=>'Ieškoti kontaktų formos','Search results for &#8220;%s&#8221;'=>'Paieškos rezultatai: „%s“','Error in deleting.'=>'Trinant įvyko klaida','You are not allowed to delete this item.'=>'Jums neleidžiama ištrinti šio elemento.','You are not allowed to edit this item.'=>'Jums neleidžiama redaguoti šio elemento.','Integration'=>'Integracijos','Add New'=>'Kurti naują','Add New Contact Form'=>'Kurti naują kontaktų formą','Contact Forms'=>'Kontaktų formos','Edit Contact Form'=>'Redaguoti kontaktų formą','Contact'=>'Kontaktų formos','Contact Form 7'=>'Contact Form 7']];